      `${process.env.REACT_APP_API_URL}/api/vimeo/getCicloData`,
      {
        method: "POST",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify({}),
      }
    );

    let responseJson = await response.json();
    return responseJson;
  } catch (error) {
    return {
      responseCode: 2,
      error: error,
    };
  }
};
